  })
  /* const ModelsStabilityArray */
  return (
    <>
      <div className="gen-models-filter__wrap">
        <h2>Quick Filter</h2>
      <FilterFrequencyType filterFrequencyTypeTC={props.filterFrequencyTypeTC}/>
